import React from "react";
import "./Settings.css";
import account from "../assets/account.svg";
import group_work from "../assets/group_work.svg";
import trash from "../assets/trash.svg";

function Settings() {
    return (
        <div>
            <div className="profile_sidebar">
                <p className="title">SETTINGS</p>
                <img src={account} alt="" height="13" width="13" />
                <p className="content">Account overview</p>
                <div>
                    <img src={group_work} alt="" height="13" width="13" />
                    <p className="content">Workspaces</p>
                </div>
                <div>
                    <img src={group_work} alt="" height="13" width="13" />
                    <p className="content">Collaborators</p>
                </div>
                <div>
                    <img src={add} alt="" height="10" width="10" />
                    <p className="content">Referrals and Credit</p>
                </div>
                <div>
                    <img src={trash} alt="" height="10" width="10" />
                    <p className="content">Trash</p>
                </div>
            </div>
        </div>
    );
}

export default Settings;
